import React from 'react';

import { Link } from 'react-router-dom';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';

import './Sidebar.css';

const Sidebar = () => {
    return (
        <div className="nav">
            <Link to='#'>
                <FaIcons.FaBars />
            </Link>
        </div>
    )
}

export default Sidebar
